import { Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import CarouselComponentNow from "./components/(utils)/CarouselNow";
import CarouselComponentWeek from "./components/(utils)/CarouselWeek";
function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/trending/all/today" element={<CarouselComponentNow />} />
      <Route path="/trending/all/week" element={<CarouselComponentWeek />} />
    </Routes>
  );
}

export default App;
